class HomeFragment : Fragment() {
    var dialog:Dialog?=null
    lateinit private var binding: FragmentHomeBinding
    lateinit var viewModel: ApiModel
    lateinit var randomMealId:String
    var lis :ArrayList<CusShown> = ArrayList()
    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        viewModel= ViewModelProvider(this)[ApiModel::class.java]
        binding = FragmentHomeBinding.inflate(layoutInflater)
    }

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View {
        try {
            binding.randomMealIV.setOnClickListener {
                var intent= Intent(requireActivity(), DishSpecification::class.java)
                intent.putExtra(Constants.DETAILS_OF_CAT_OR_CUS,randomMealId)
                startActivity(intent)
            }
            populateData()
            binding.cuisineRV.visibility=View.GONE
            showProgressBar(requireContext())
            viewModel.getRandomMeal(requireActivity())
            viewModel.observeGetRandomMeal().observe(viewLifecycleOwner, Observer { result ->
                if (result.isSuccessful) {
                    if (result.body() != null) {
                        Glide
                            .with(requireContext())
                            .load(result.body()!!.meals?.get(0)?.strMealThumb)
                            .centerCrop()
                            .placeholder(R.drawable.img)
                            .into(binding.randomMealIV)
                        binding.randomMealCardView.visibility=View.VISIBLE
                        randomMealId= result.body()!!.meals?.get(0)?.idMeal ?: "0"
                    } else {
                        Log.d("rk", "body is null")
                    }
                } else {
                    // Handle the case where the request fails
                    val errorBody = result.errorBody()?.string()
                    if (errorBody != null) {
                        Log.d("rk", errorBody)
                    } else {
                        Log.d("rk", "Unknown error")
                    }
                }
            })
            viewModel.getCategoriesMeal(requireActivity())
            viewModel.observeGetCategoriesMeal().observe(viewLifecycleOwner, Observer { result->
                cancelProgressBar()
                if (result.isSuccessful) {
                    if (result.body() != null) {
                        var lis=ArrayList<CatShown>()
                        for(i in 0..result.body()!!.categories!!.size-1)
                        {
                            lis.add(CatShown(result.body()?.categories?.get(i)!!.strCategory,result.body()?.categories?.get(i)!!.strCategoryThumb))
                        }
                        displayCategoriesAdapter(lis)
                    } else {
                        Log.d("rk", "body is null")
                    }
                } else {
                    val errorBody = result.errorBody()?.string()
                    if (errorBody != null) {
                        Log.d("rk", errorBody)
                    } else {
                        Log.d("rk", "Unknown error")
                    }
                }
            })
            displayCuisineAdapter(lis)
            binding.seeAllCategories.setOnClickListener {
                var intent= Intent(requireContext(),SeeAllCatCus::class.java)
                intent.putExtra(Constants.SEE_ALL_CAT_OR_CUS,"categories")
                startActivity(intent)
            }
            binding.seeAllCuisine.setOnClickListener {
                var intent= Intent(requireContext(),SeeAllCatCus::class.java)
                intent.putExtra(Constants.SEE_ALL_CAT_OR_CUS,"cuisine")
                startActivity(intent)
            }
        } catch (e: Exception) {
            Log.d("rk", e.message.toString())
        }
        binding.searchView.setOnClickListener {
                val intent = Intent(requireContext(), SearchActivity::class.java)
                startActivity(intent)
        }
        return binding.root
    }

    fun updateUI(message: String) {
        Toast.makeText(requireContext(),message,Toast.LENGTH_LONG).show()
    }
    fun showProgressBar(context: Context) {
        dialog = Dialog(context)
        dialog!!.setContentView(R.layout.progress_bar)
        dialog!!.window?.apply {
            setBackgroundDrawableResource(android.R.color.transparent) // Optional: Set background to transparent
            setLayout(ViewGroup.LayoutParams.MATCH_PARENT, ViewGroup.LayoutParams.MATCH_PARENT)
            setFlags(WindowManager.LayoutParams.FLAG_FULLSCREEN, WindowManager.LayoutParams.FLAG_FULLSCREEN)
        }

        dialog!!.show()
    }
    fun cancelProgressBar()
    {
        if(dialog!=null)
        {
            dialog!!.dismiss()
            dialog=null
        }
    }
    fun displayCategoriesAdapter(lis:ArrayList<CatShown>)
    {
        var liss = lis.sortedBy { it.name }
        binding.categoriesRV.layoutManager = LinearLayoutManager(requireContext(),LinearLayoutManager.HORIZONTAL, false)
        val ItemAdapter = CategoriesAdapter(liss,requireContext())
        binding.categoriesRV.adapter = ItemAdapter
        binding.cuisineRV.visibility=View.VISIBLE
        binding.CatLL.visibility=View.VISIBLE
        binding.CusLL.visibility=View.VISIBLE
        ItemAdapter.setOnClickListener(object :
            CategoriesAdapter.OnClickListener {
            override fun onClick(position: Int, model: CatShown) {
                Log.d("rk",model.name.toString())
                var intent=Intent(requireActivity(),DetailOfCatCus::class.java)
                intent.putExtra(Constants.DETAILS_OF_CAT_OR_CUS,model.name.toString())
                startActivity(intent)
            }
        })
    }
    fun displayCuisineAdapter(lis:ArrayList<CusShown>)
    {
        binding.cuisineRV.layoutManager = LinearLayoutManager(requireContext(),LinearLayoutManager.HORIZONTAL, false)
        val ItemAdapter = CusianAdapter(lis,requireContext())
        binding.cuisineRV.adapter = ItemAdapter
        ItemAdapter.setOnClickListener(object :
            CusianAdapter.OnClickListener {
            override fun onClick(position: Int, model: CusShown) {
                Log.d("rk",model.name.toString())
                var intent=Intent(requireActivity(),DetailOfCatCus::class.java)
                intent.putExtra(Constants.DETAILS_OF_CAT_OR_CUS,model.name.toString())
                startActivity(intent)
            }
        })
    }
